import React from 'react';
import { BrowserRouter as Router, Route, Switch, NavLink } from 'react-router-dom';
import AlunoList from './AlunoList';
import AlunosPorCurso from './AlunosPorCurso';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <NavLink to="/alunos">Listar Alunos</NavLink>
            </li>
            <li>
              <NavLink to="/alunos-por-curso">Agrupar por Curso</NavLink>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/alunos" component={AlunoList} />
          <Route path="/alunos-por-curso" component={AlunosPorCurso} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
